import React, { useEffect, useState } from "react";
import toast from "react-hot-toast";
import {
  useCreateModelMutation,
  useUpdateModelMutation,
} from "../../../redux/api/modelApi";

const ModelForm = ({ model, onClose, refetch }) => {
  const isEdit = Boolean(model?._id);

  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    stageName: "",
    gender: "Female",
    email: "",
    phone: "",
    city: "",
    country: "",
    status: "pending",
  });

  const [createModel, { isLoading: creating }] = useCreateModelMutation();
  const [updateModel, { isLoading: updating }] = useUpdateModelMutation();

  useEffect(() => {
    if (model) {
      setForm({
        firstName: model.firstName || "",
        lastName: model.lastName || "",
        stageName: model.stageName || "",
        gender: model.gender || "Female",
        email: model.email || "",
        phone: model.phone || "",
        city: model.city || "",
        country: model.country || "",
        status: model.status || "pending",
      });
    }
  }, [model]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((p) => ({ ...p, [name]: value }));
  };

  const submit = async (e) => {
    e.preventDefault();
    try {
      if (isEdit) {
        await updateModel({
          id: model._id,
          data: form,
        }).unwrap();
        toast.success("Model updated");
      } else {
        await createModel(form).unwrap();
        toast.success("Model created");
      }

      refetch();
      onClose();
    } catch (err) {
      toast.error(err?.data?.message || "Save failed");
    }
  };

  return (
    <div className="card mb-4">
      <div className="card-header">
        <h5 className="mb-0">{isEdit ? "Edit Model" : "Add Model"}</h5>
      </div>

      <div className="card-body">
        <form onSubmit={submit} className="row g-3">
          <div className="col-md-4">
            <label>First Name *</label>
            <input
              required
              name="firstName"
              className="form-control"
              value={form.firstName}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-4">
            <label>Last Name</label>
            <input
              name="lastName"
              className="form-control"
              value={form.lastName}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-4">
            <label>Stage Name</label>
            <input
              name="stageName"
              className="form-control"
              value={form.stageName}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-3">
            <label>Gender</label>
            <select
              name="gender"
              className="form-control"
              value={form.gender}
              onChange={handleChange}
            >
              <option>Female</option>
              <option>Male</option>
              <option>Non-binary</option>
              <option>Other</option>
            </select>
          </div>

          <div className="col-md-3">
            <label>Email</label>
            <input
              type="email"
              name="email"
              className="form-control"
              value={form.email}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-3">
            <label>Phone</label>
            <input
              name="phone"
              className="form-control"
              value={form.phone}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-3">
            <label>Status</label>
            <select
              name="status"
              className="form-control"
              value={form.status}
              onChange={handleChange}
            >
              <option value="pending">Pending</option>
              <option value="approved">Approved</option>
              <option value="rejected">Rejected</option>
              <option value="inactive">Inactive</option>
            </select>
          </div>

          <div className="col-md-6">
            <label>Country</label>
            <input
              name="country"
              className="form-control"
              value={form.country}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>City</label>
            <input
              name="city"
              className="form-control"
              value={form.city}
              onChange={handleChange}
            />
          </div>

          <div className="col-md-12 d-flex gap-2">
            <button className="btn btn-success" disabled={creating || updating}>
              {isEdit ? "Update" : "Create"}
            </button>
            <button
              type="button"
              className="btn btn-secondary"
              onClick={onClose}
            >
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default ModelForm;
